import React, { useState } from "react";
import axios from "axios";

function TransactionsList() {
  const [data, setData] = useState([]);

  const getData = () => {
    axios
      .get(`http://localhost:8000/transaction/`, { crossdomain: true })
      .then((result) => {
        setData(result.data.total);
      })
      .catch((error) => {
        console.log("Error", error);
      });
    console.log(data);
  };
  React.useEffect(() => {
    getData();
    console.log(data);
  }, []);
  return (
    <div>
      {data?.map((item) => {
        return <div>{item.sender_account}</div>;
      })}
    </div>
  );
}

export default TransactionsList;
